	TabJmp		MemCpyNeonUpDstAlignTab, x3, x4, x3, w3		//32-x3就是进行目的地址32字节对齐需要复制的长度。因为ldrb的地址范围不够，且ldrh和ldrb都要进行零值扩展，所以这里不能用.short和.byte。
